import Markdown from "react-markdown";
import Button from "./dawn-ui/components/Button";
import Column from "./dawn-ui/components/Column";
import Container from "./dawn-ui/components/Container";
import Content from "./dawn-ui/components/Content";
import GoogleMatieralIcon from "./dawn-ui/components/GoogleMaterialIcon";
import Row from "./dawn-ui/components/Row";
import Sidebar from "./dawn-ui/components/Sidebar";
import Words from "./dawn-ui/components/Words";
import remarkGfm from "remark-gfm";

export default function App() {
  return (
    <Row className="full-page">
      <Sidebar>
        <Words type="page-title" style={{ textAlign: "center" }}>
          IsaWiki
        </Words>
        <hr />
      </Sidebar>
      <Content util={["width-100"]} style={{ overflowY: "scroll" }}>
        <Column util={["width-100"]}>
          <Words type="heading">Article Name</Words>
          <Row>
            <Row util={["small-gap", "flex-grow"]}>
              {["test", "meow", "woof"].map((x) => (
                <Button util={["round"]}>
                  <Row util={["small-gap"]}>
                    <GoogleMatieralIcon name="sell" size="16px" />
                    {x}
                  </Row>
                </Button>
              ))}
            </Row>
            <Row util={["align-center"]} style={{ flexBasis: "fit-content" }}>
              Basic Details
            </Row>
          </Row>
          <Row>
            <Container
              util={["width-100"]}
              style={{ lineHeight: "1.6", minWidth: "400px" }}
            >
              <Markdown remarkPlugins={[remarkGfm]}>
                {`# This is a markdown test.\nHello!
              Markdown is *really* cool.  \nAnd it is ***very*** useful in a place like here!\n~~wow!~~`.replace(
                  /\n/,
                  "  \n"
                )}
              </Markdown>
            </Container>
            <Container
              style={{ width: "350px", minWidth: "100px" }}
              title="Something"
            ></Container>
          </Row>
        </Column>
      </Content>
    </Row>
  );
}
